IF  EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'dbo.gpAnnotation') AND type in (N'U')) DROP TABLE dbo.gpAnnotation;


CREATE TABLE dbo.gpAnnotation (
  idAnnotation int  NOT NULL identity,
  name varchar(2000) NOT NULL,
  description varchar(max)  NULL,
  fileName varchar(2000)  NULL,
  idGenomeVersion int  NOT NULL,
  codeVisibility varchar(10) NOT NULL,
  idUser int   NULL,
  idUserGroup int   NULL,
  summary varchar(5000)  NULL,
  createdBy varchar(200)  NULL,
  createDate datetime  NULL,
  isLoaded char(1) default 'N',
  idInstitute int   NULL,
  dataPath varchar(500)  NULL,
CONSTRAINT [PK_Annotation] PRIMARY KEY CLUSTERED 
(
	[idAnnotation] ASC
),
  
  
  
  
  
  CONSTRAINT FK_Annotation_GenomeVersion FOREIGN KEY (idGenomeVersion) REFERENCES dbo.gpGenomeVersion (idGenomeVersion),
  CONSTRAINT FK_Annotation_Institute FOREIGN KEY (idInstitute) REFERENCES dbo.gpInstitute (idInstitute) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT FK_Annotation_User FOREIGN KEY (idUser) REFERENCES dbo.gpUser (idUser),
  CONSTRAINT FK_Annotation_UserGroup FOREIGN KEY (idUserGroup) REFERENCES dbo.gpUserGroup (idUserGroup),
  CONSTRAINT FK_Annotation_Visibility FOREIGN KEY (codeVisibility) REFERENCES dbo.gpVisibility (codeVisibility)
)  ;


