(823,'Test','','A823',3405,'MEM',3,8,'','u0028003','2010-04-13 00:00:00','Y',NULL,'/Data02/GenoPub/GenoPubData/'),
(881,'BinPVal','<P ALIGN=""LEFT"">Comparison of the simulated chIP vs Input ChIPSeqChallenge 1.0 datasets</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">These datasets, user submissions, and results have been archived on Sourceforge under the USeq project under <A HREF=""https://sourceforge.net/project/showfiles.php?group_id=222996&package_id=317544"" TARGET=""_blank""><B><U>CommunityChIPSeqChallenge</U></B></A>.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Windows</B>: several different measurements related to the overlapping window scanning summary statistics created by ScanSeqs. These are best used for visualization in the IGB. For each summary score, two types of window representations maybe generated. HeatMap is a window representation best viewed in IGB as a stair-step or heatmap. Point window summaries are where the window score is assigned to the center position in the window. Both use the xxx.bar.zip binary format.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>BinPVal</B>: -10Log10(p-values) - Bionomial p-values for each window calculated by comparing the number of treatment reads to the number of control reads. Not multiple test corrected. Treat this as a variance corrected score for ranking purposes.</P>','A881',3405,'PUBLIC',3,28,'USeq''s ScanSeqs window level -10Log10(binomial pvalue) score from the ChIPSeqChallenge 1.0',NULL,NULL,'Y',NULL,'/Data02/GenoPub/GenoPubData/'),
(882,'EmpFDR','<P ALIGN=""LEFT"">Comparison of the simulated chIP vs Input ChIPSeqChallenge 1.0 datasets</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">These datasets, user submissions, and results have been archived on Sourceforge under the USeq project under <A HREF=""https://sourceforge.net/project/showfiles.php?group_id=222996&package_id=317544"" TARGET=""_blank""><B><U>CommunityChIPSeqChallenge</U></B></A>.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Windows</B>: several different measurements related to the overlapping window scanning summary statistics created by ScanSeqs. These are best used for visualization in the IGB. For each summary score, two types of window representations maybe generated. HeatMap is a window representation best viewed in IGB as a stair-step or heatmap. Point window summaries are where the window score is assigned to the center position in the window. Both use the xxx.bar.zip binary format.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>QValFDR</B>: -10Log10(q-values) - Window level bionomial p-values converted into q-value FDRs using John Storey&apos;s R package. </P>','A882',3405,'PUBLIC',3,28,'USeq''s ScanSeqs window level -10Log10(qValueFDR) score from the ChIPSeqChallenge 1.0',NULL,NULL,'Y',NULL,'/Data02/GenoPub/GenoPubData/'),
(883,'QValFDR','<P ALIGN=""LEFT"">Comparison of the simulated chIP vs Input ChIPSeqChallenge 1.0 datasets</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">These datasets, user submissions, and results have been archived on Sourceforge under the USeq project under <A HREF=""https://sourceforge.net/project/showfiles.php?group_id=222996&package_id=317544/"" TARGET=""_blank""><B><U>CommunityChIPSeqChallenge</U></B></A>.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Windows</B>: several different measurements related to the overlapping window scanning summary statistics created by ScanSeqs. These are best used for visualization in the IGB. For each summary score, two types of window representations maybe generated. HeatMap is a window representation best viewed in IGB as a stair-step or heatmap. Point window summaries are where the window score is assigned to the center position in the window. Both use the xxx.bar.zip binary format.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>EmpFDR</B>: -10Log10(FDR) - Empirical false discovery rates based on a control vs control null distribution.</P>','A883',3405,'PUBLIC',3,28,'USeq''s ScanSeqs window level -10Log10(empFDR) FDR from the ChIPSeqChallenge 1.0',NULL,NULL,'Y',NULL,'/Data02/GenoPub/GenoPubData/');

