(1262,'QValFDR','<P ALIGN=""LEFT"">A reanalysis of Valoue et.al.&apos;s <A HREF=""http://mendel.stanford.edu/SidowLab/downloads/quest/index.html"" TARGET=""_blank""><B><U>GABP Nature Genetics chIP-seq dataset</U></B></A> using <A HREF=""http://useq.sourceforge.net"" TARGET=""_blank""><B><U>USeq</U></B></A><B><U>.</U></B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B># Convert to PointData </B></P><P ALIGN=""LEFT"">jj ~/USeqApps/Tag2Point -v H_sapiens_Mar_2006 -i 3 -f /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/Jurkat_RX_noIP.align_25.hg18.txt.bed </P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B># Run ScanSeqs to determine shift</B></P><P ALIGN=""LEFT"">jj ~/USeqApps/ScanSeqs -s /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/NoCenterResults/Plus -t /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/GABP+ -l 2927734026 -r /usr/bin/R -w 50 -m 1 -j -a</P><P ALIGN=""LEFT"">jj ~/USeqApps/ScanSeqs -s /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/NoCenterResults/Min -t /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/GABP- -l 2927734026 -r /usr/bin/R -w 50 -m 1 -j -a </P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>#Filtering agaist satellite repeats and shifting 39bp using corrected filter</B></P><P ALIGN=""LEFT"">jj ~/USeqApps/FilterPointData -p /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/PointData/GABP_Jurkat_SL12.align_25.hg18.txt_Point -r /Users/nix/Desktop/hg18Satellite.bed -s 39</P><P ALIGN=""LEFT"">jj ~/USeqApps/FilterPointData -p /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/PointData/Jurkat_RX_noIP.align_25.hg18.txt_Point -r /Users/nix/Desktop/hg18Satellite.bed -s 39</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Fraction removed:</P><P ALIGN=""LEFT"">	0.003 (26738/7835493) GABP_Jurkat_SL12.align_25.hg18.txt_Point</P><P ALIGN=""LEFT"">	0.006 (107996/17296926) Jurkat_RX_noIP.align_25.hg18.txt_Point</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>#Subsampled the control data to match the treatment</B></P><P ALIGN=""LEFT"">java -Xmx1000M edu/utah/seq/data/SubSamplePointData -f /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/PointData/Jurkat_RX_noIP.align_25.hg18.txt_Point_hg18Satellite_Filtered_39bp/ -n 7835493 -s /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/PointData/Jurkat_RX_noIP_Filtered_39_SubSampled</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B># Launch USeq Win 500bp, Min 10 reads, max control 300</B></P><P ALIGN=""LEFT"">jj ~/USeqApps/ScanSeqs \\</P><P ALIGN=""LEFT"">-s /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/ResultsMin10_500bp \\</P><P ALIGN=""LEFT"">-t /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/PointData/GABP_Jurkat_SL12.align_25.hg18.txt_Point_hg18Satellite_Filtered_39bp \\</P><P ALIGN=""LEFT"">-c /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/PointData/Jurkat_RX_noIP.align_25.hg18.txt_Point_hg18Satellite_Filtered_39bp \\</P><P ALIGN=""LEFT"">-l 2927734026 -r /usr/bin/R -w 500 -m 10 -j -b -e -f -g 300</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Minimum number window reads 10</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Merging controls...</P><P ALIGN=""LEFT"">Merging treatments...</P><P ALIGN=""LEFT"">Random sub sampling data...</P><P ALIGN=""LEFT"">	#Ts 7835493  #Cs 17296926</P><P ALIGN=""LEFT"">	Reducing number control observations to match 2x treatments, 15670986</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Processing window size 500</P><P ALIGN=""LEFT"">	Calculating and saving normalized difference window bar files.........................</P><P ALIGN=""LEFT"">	Filtering windows based on control data window read count...</P><P ALIGN=""LEFT"">		7885(0.3%) windows removed. Minimum window sum of filtered window, 300.0</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>#Make Enriched Regions, thresholding at 20 and 30, QValFDR and EmpFDR</B></P><P ALIGN=""LEFT"">jj ~/USeqApps/EnrichedRegionMaker \\</P><P ALIGN=""LEFT"">-t /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/PointData/GABP_Jurkat_SL12.align_25.hg18.txt_Point_hg18Satellite_Filtered_39bp \\</P><P ALIGN=""LEFT"">-c /Users/nix/HCI/PIs/Graves/Seq/GABP_ValouevNatMeth08/PointData/Jurkat_RX_noIP.align_25.hg18.txt_Point_hg18Satellite_Filtered_39bp \\</P><P ALIGN=""LEFT"">-f . \\</P><P ALIGN=""LEFT"">-s 20,30 \\</P><P ALIGN=""LEFT"">-g 300 \\</P><P ALIGN=""LEFT"">-i 4 </P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">300	Max Gap</P><P ALIGN=""LEFT"">4	Score Index</P><P ALIGN=""LEFT"">50	Sub Window Size</P><P ALIGN=""LEFT"">Processing gabp.swi...</P><P ALIGN=""LEFT"">20.0	Score Threshold</P><P ALIGN=""LEFT"">	9640	EnrichedRegions created</P><P ALIGN=""LEFT"">30.0	Score Threshold</P><P ALIGN=""LEFT"">	8164	EnrichedRegions created</P><P ALIGN=""LEFT"">737263	Total number of windows</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">300	Max Gap</P><P ALIGN=""LEFT"">5	Score Index</P><P ALIGN=""LEFT"">50	Sub Window Size</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Processing gabp.swi...</P><P ALIGN=""LEFT"">20.0	Score Threshold</P><P ALIGN=""LEFT"">	8587	EnrichedRegions created</P><P ALIGN=""LEFT"">30.0	Score Threshold</P><P ALIGN=""LEFT"">	7619	EnrichedRegions created</P>','A1262',3405,'PUBLIC',3,13,'QValue False Discovery Rate Graph based on fuzzy binomial p-values',NULL,NULL,'Y',NULL,'/Data02/GenoPub/GenoPubData/'),
