(1844,'Primate DNA Conservation','<P ALIGN=""LEFT""><B>Conservation (cons44way) Track Description</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">This track shows multiple alignments of 44 vertebrate species and measurements of evolutionary conservation using two methods (phastCons and phyloP) from the PHAST package, for all species (vertebrate) and two subsets (primate and placental mammal). The multiple alignments were generated using multiz and other tools in the UCSC/Penn State Bioinformatics comparative genomics alignment pipeline. Conserved elements identified by phastCons are also displayed in this track.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">PhastCons (which has been used in previous Conservation tracks) is a hidden Markov model-based method that estimates the probability that each nucleotide belongs to a conserved element, based on the multiple alignment. It considers not just each individual alignment column, but also its flanking columns. By contrast, phyloP separately measures conservation at individual columns, ignoring the effects of their neighbors. As a consequence, the phyloP plots have a less smooth appearance than the phastCons plots, with more &quot;texture&quot; at individual sites. The two methods have different strengths and weaknesses. PhastCons is sensitive to &quot;runs&quot; of conserved sites, and is therefore effective for picking out conserved elements. PhyloP, on the other hand, is more appropriate for evaluating signatures of selection at particular nucleotides or classes of nucleotides (e.g., third codon positions, or first positions of miRNA target sites).</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Another important difference is that phyloP can measure acceleration (faster evolution than expected under neutral drift) as well as conservation (slower than expected evolution). In the phyloP plots, sites predicted to be conserved are assigned positive scores (and shown in blue), while sites predicted to be fast-evolving are assigned negative scores (and shown in red). The absolute values of the scores represent -log p-values under a null hypothesis of neutral evolution. The phastCons scores, by contrast, represent probabilities of negative selection and range between 0 and 1.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Both phastCons and phyloP treat alignment gaps and unaligned nucleotides as missing data, and both were run with the same parameters for each species set (vertebrates, placental mammals, and primates). Thus, in regions in which only primates appear in the alignment, all three sets of scores will be the same, but in regions in which additional species are available, the mammalian and/or vertebrate scores may differ from the primate scores. The alternative plots help to identify sequences that are under different evolutionary pressures in, say, primates and non-primates, or mammals and non-mammals.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">The species aligned for this track include the reptile, amphibian, bird, and fish clades, as well as marsupial, monotreme (platypus), and placental mammals. Compared to the previous 28-vertebrate alignment, this track includes 16 new species and 8 species with updated sequence assemblies (Table 1). The new species consist of two high-coverage (5-8.5X) assemblies (orangutan, zebra finch), low-coverage draft assemblies of gorilla, marmoset, tarsier, mouse lemur, kangaroo rat, squirrel, pika, megabat, microbat, dolphin, alpaca, sloth, rock hyrax and lamprey. The mouse, cow, guinea pig, horse, elephant, zebrafish, and medaka assemblies have been updated from those used in the previous 28-species alignment.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">UCSC has repeatmasked and aligned the low-coverage genome assemblies, and provides the sequence for download; however, we do not construct genome browsers for them. Missing sequence in the low-coverage assemblies is highlighted in the track display by regions of yellow when zoomed out and Ns displayed at base level (see Gap Annotation, below).</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Downloaded from <A HREF=""http://hgdownload.cse.ucsc.edu/goldenPath/hg18/phastCons44way/primates/"" TARGET=""_blank""><B><U>http://hgdownload.cse.ucsc.edu/goldenPath/hg18/phastCons44way/primates/</U></B></A></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Credits</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">This track was created using the following programs:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Alignment tools: blastz and multiz by Minmei Hou, Scott Schwartz and Webb Miller of the Penn State Bioinformatics Group</P><P ALIGN=""LEFT"">Chaining and Netting: axtChain, chainNet by Jim Kent at UCSC</P><P ALIGN=""LEFT"">Conservation scoring: phastCons, phyloP, phyloFit, tree_doctor, msa_view and other programs in PHAST by Adam Siepel at Cornell University (original development done at the Haussler lab at UCSC).</P><P ALIGN=""LEFT"">MAF Annotation tools: mafAddIRows by Brian Raney, UCSC; mafAddQRows by Richard Burhans, Penn State; genePredToMafFrames by Mark Diekhans, UCSC</P><P ALIGN=""LEFT"">Tree image generator: phyloGif by Galt Barber, UCSC</P><P ALIGN=""LEFT"">Conservation track display: Kate Rosenbloom, Hiram Clawson (wiggle display), and Brian Raney (gap annotation and codon framing) at UCSC</P><P ALIGN=""LEFT"">The phylogenetic tree is based on Murphy et al. (2001) and general consensus in the vertebrate phylogeny community as of March 2007.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">References</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Phylo-HMMs, phastCons, and phyloP:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Pollard KS, Hubisz MJ, Siepel A. Detection of non-neutral substitution rates on mammalian phylogenies. Genome Res. 2009 Oct 26. [Epub ahead of print]</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Siepel A, Bejerano G, Pedersen JS, Hinrichs AS, Hou M, Rosenbloom K, Clawson H, Spieth J, Hillier LW, Richards S, et al. Evolutionarily conserved elements in vertebrate, insect, worm, and yeast genomes. Genome Res. 2005 Aug;15(8):1034-50.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Chain/Net:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Kent WJ, Baertsch R, Hinrichs A, Miller W, Haussler D. Evolution&apos;s cauldron: duplication, deletion, and rearrangement in the mouse and human genomes. Proc Natl Acad Sci U S A. 2003 Sep 30;100(20):11484-9.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Multiz:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Blanchette M, Kent WJ, Riemer C, Elnitski L, Smit AF, Roskin KM, Baertsch R, Rosenbloom K, Clawson H, Green ED, et al. Aligning multiple genomic sequences with the threaded blockset aligner. Genome Res. 2004 Apr;14(4):708-15.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Blastz:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Chiaromonte F, Yap VB, Miller W. Scoring pairwise genomic sequence alignments. Pac Symp Biocomput. 2002;:115-26.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Schwartz S, Kent WJ, Smit A, Zhang Z, Baertsch R, Hardison RC, Haussler D, Miller W. Human-mouse alignments with BLASTZ. Genome Res. 2003 Jan;13(1):103-7.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Phylogenetic Tree:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Murphy WJ, Eizirik E, O&apos;Brien SJ, Madsen O, Scally M, Douady CJ, Teeling E, Ryder OA, Stanhope MJ, de Jong WW, Springer MS. Resolution of the early placental mammal radiation using Bayesian phylogenetics. Science. 2001 Dec 14;294(5550):2348-51</P>','A1844',3405,'PUBLIC',NULL,28,'Phast Con 44 Way Primates from UCSC',NULL,NULL,'Y',NULL,'/Data02/GenoPub/GenoPubData/'),
