(3380,'smRNA and mRNA 2-10 alignments','<P ALIGN=""LEFT"">110216</P><P ALIGN=""LEFT"">Downloaded mRNA and smRNA datasets in .sra format for H1 from SRA, UCSD ENCODE.</P><P ALIGN=""LEFT"">Converted to .fastq</P><P ALIGN=""LEFT"">Aligned with novoalign.  Default adapter sequence (checked on GEO).  Standard format.  </P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">cd /MacHome/andrew/temp/H1_sra/ftp-trace.ncbi.nlm.nih.gov/sra/sra-instant/reads/ByExp/sra/SRX</P><P ALIGN=""LEFT"">smRNA</P><P ALIGN=""LEFT"">nohup novoalign -FSTDFQ -m -l17 -h90 -t30 -rA 15 -q 3 -c 10 -a -d /usr/local/share/novo_indices/hg18WithSplicesAdaptersk13s3 -f SRR020285.fastq &gt;&amp; /MacHome/andrew/BioAnalysis/Sue/H1_RNA/110216_smRNA_H1_SRR020285.novo.txt &amp;	</P><P ALIGN=""LEFT"">mRNA</P><P ALIGN=""LEFT"">put this in a shell script, looping through each file.</P><P ALIGN=""LEFT"">nohup novoalign -FSTDFQ -m -l17 -t60 -rA 10 -q 3 -c 10 -a -d /usr/local/share/novo_indices/hg18WithSplicesAdaptersk13s3 -f .fastq &gt;&amp; /MacHome/andrew/BioAnalysis/Sue/H1_RNA/101008_am_7396X2_s5.txt &amp;	</P><P ALIGN=""LEFT"">Started at about 11:45pm. Finished at 2am.  ~2 hrs.</P><P ALIGN=""LEFT"">Converted with Novo2Bed.pl --zerobase --gzip.</P><P ALIGN=""LEFT"">BedAlignFilter.pl for smRNA to get unique, 2-10 and 1-10.  For mRNA to get unique and 2-10 and 1-10 as well.</P><P ALIGN=""LEFT"">Took about 3.5 hours.  Used run_bedalignfilter.sh (ad hoc).  </P><P ALIGN=""LEFT"">Converted to Point with jj ~/USeqApps/Tag2Point -v H_sapiens_Mar_2006 -f &lt;folder&gt;</P><P ALIGN=""LEFT"">Made ReadCoverage files with this type of command: jj ~/USeqApps/ReadCoverage -p 1to10 -s 1to10_ReadCov -k -r</P><P ALIGN=""LEFT"">for i in *ReadCov; do jj ~/USeqApps/Bar2USeq -r 1 -f $i; done</P>','A3380',3405,'MEM',43,7,'','Andrew','2011-02-17 00:00:00','Y',NULL,'/Data02/GenoPub/GenoPubData/'),
(3381,'smRNA and mRNA unique alignments','<P ALIGN=""LEFT"">110216</P><P ALIGN=""LEFT"">Downloaded mRNA and smRNA datasets in .sra format for H1 from SRA, UCSD ENCODE.</P><P ALIGN=""LEFT"">Converted to .fastq</P><P ALIGN=""LEFT"">Aligned with novoalign.  Default adapter sequence (checked on GEO).  Standard format.  </P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">cd /MacHome/andrew/temp/H1_sra/ftp-trace.ncbi.nlm.nih.gov/sra/sra-instant/reads/ByExp/sra/SRX</P><P ALIGN=""LEFT"">smRNA</P><P ALIGN=""LEFT"">nohup novoalign -FSTDFQ -m -l17 -h90 -t30 -rA 15 -q 3 -c 10 -a -d /usr/local/share/novo_indices/hg18WithSplicesAdaptersk13s3 -f SRR020285.fastq &gt;&amp; /MacHome/andrew/BioAnalysis/Sue/H1_RNA/110216_smRNA_H1_SRR020285.novo.txt &amp;	</P><P ALIGN=""LEFT"">mRNA</P><P ALIGN=""LEFT"">put this in a shell script, looping through each file.</P><P ALIGN=""LEFT"">nohup novoalign -FSTDFQ -m -l17 -t60 -rA 10 -q 3 -c 10 -a -d /usr/local/share/novo_indices/hg18WithSplicesAdaptersk13s3 -f .fastq &gt;&amp; /MacHome/andrew/BioAnalysis/Sue/H1_RNA/101008_am_7396X2_s5.txt &amp;	</P><P ALIGN=""LEFT"">Started at about 11:45pm. Finished at 2am.  ~2 hrs.</P><P ALIGN=""LEFT"">Converted with Novo2Bed.pl --zerobase --gzip.</P><P ALIGN=""LEFT"">BedAlignFilter.pl for smRNA to get unique, 2-10 and 1-10.  For mRNA to get unique and 2-10 and 1-10 as well.</P><P ALIGN=""LEFT"">Took about 3.5 hours.  Used run_bedalignfilter.sh (ad hoc).  </P><P ALIGN=""LEFT"">Converted to Point with jj ~/USeqApps/Tag2Point -v H_sapiens_Mar_2006 -f &lt;folder&gt;</P><P ALIGN=""LEFT"">Made ReadCoverage files with this type of command: jj ~/USeqApps/ReadCoverage -p 1to10 -s 1to10_ReadCov -k -r</P><P ALIGN=""LEFT"">for i in *ReadCov; do jj ~/USeqApps/Bar2USeq -r 1 -f $i; done</P>','A3381',3405,'MEM',43,7,'','Andrew','2011-02-17 00:00:00','Y',NULL,'/Data02/GenoPub/GenoPubData/'),
