(3779,'7741X1 Tophat','<P ALIGN=""LEFT"">#Trying Novoalign on the same junctions found by tophat (plus knownGene and ensGene).	</P><P ALIGN=""LEFT"">	#Downloaded knownGene and ensGene tables from hg19 (UCSC).  Combined with junctions from 7741X1 and 7623X1 (after input 7741).  Removed lines with random, hap and chrUn.</P><P ALIGN=""LEFT"">		cat hg19_knownGene_ensGene_7741_7623_Splices.ucsc | grep -v &quot;hap&quot; | grep -v &quot;random&quot; | grep -v &quot;chrUn&quot; &gt; hg19_knownGene_ensGene_7741_7623_Splices_norandomhapUn.ucsc</P><P ALIGN=""LEFT"">	#Made fasta file on updraft qsub simple_MSJF.sh (not showing PBS options):</P><P ALIGN=""LEFT"">		java -Xmx20G -jar /uufs/chpc.utah.edu/common/home/u0491180/Apps/USeq/Apps/MakeSpliceJunctionFasta \\</P><P ALIGN=""LEFT"">		-f /uufs/chpc.utah.edu/common/home/u0491180/sc/Genomes/Human/hg19 \\</P><P ALIGN=""LEFT"">		-u /scratch/ibrix/chpc_gen/u0491180/hg19_knownGene_ensGene_7741_7623_Splices_norandomhapUn.ucsc \\</P><P ALIGN=""LEFT"">		-s 46 \\</P><P ALIGN=""LEFT"">		-r /scratch/ibrix/chpc_gen/u0491180/hg19_kg_ens_tophat7741_7623_Splices.fa</P><P ALIGN=""LEFT"">	#novoindex on updraft</P><P ALIGN=""LEFT"">		~/Apps/novocraft/novoindex -k13 -s3 ~/sc/Genomes/hg19LambdaAdaptersTophatSplicesk13s3 *.fa</P><P ALIGN=""LEFT"">   #novoalign</P><P ALIGN=""LEFT"">          /uufs/chpc.utah.edu/common/home/u0491180/Apps/novocraft/novoalign -FILMFQ -t90 -rA 10 -d hg19LambdaAdaptersTophat7741Junctionsk13s3 -f 7741X1_60files_00.txt.gz -a  | gzip &gt; 7741X1_60files_00_novo.gz </P><P ALIGN=""LEFT""></P>','A3779',6300,'MEM',43,7,'','Andrew','2011-06-20 00:00:00','Y',NULL,'/Data02/GenoPub/GenoPubData/'),
