(6300,'Chip Seq Challenge 1.0','<P ALIGN=""LEFT""><B>ChIP-Seq Community Challenge 1.0 Report</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">The chIP-seq community challenge is an effort to benchmark chIP-seq detection algorithms using a common dataset containing simulated chIP-seq peaks.  The advantages to using simulated peaks are numerous. Known truth can be used to unambiguously evaluate different algorithms, simulations allow one to model specific types of chIP-seq datasets, and simulations enable rapid prototyping under a variety of conditions.  Simulations also come with a variety of pitfalls, namely, over simplification of actual data, idealized random distributions, and a potential to miss uncharacterized experimental bias.  By combining simulated chIP-seq reads with real experimentally derived input sequencing data we hoped to provide hybrid datasets that can be used in a larger testing framework that includes real chIP-seq datasets for evaluating novel chIP-seq detection algorithms. See below for a description of the simulated chIP-seq datasets.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">As a first pass, the chIP-seq community challenge, was a resounding success with 13 submissions representing 12 different peak detection packages from both academic and industry groups. See peakDetectorPackages.xls. We would like to thank each of the submitters and both Illumina and Applied Biosciences for sponsoring this contest.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">The contest focused on two key aspects of chIP-seq analysis: 1) discrimination between true positives and false positives, and 2) accurate confidence estimation in a given list of candidate binding peaks. The discrimination test is based on a simple summary statistic, the total number of recovered chIP-seq peaks from lists containing the top 500, 1000, and 1500 candidate regions.  See the topHitListResults.xls file.  For a more comprehensive analysis see the rocResults.xls file.  This contains plots of the true positive rate versus the false discovery rate (FDR) for a ranked intersection from the top 1500 region lists. Both analysis show MACS, USeq, Partek, SWEMBL, and BPC algorithms as the best discriminators with prizes going to Tao Liu (iPod Shuffle), Mali Salmon, Justin Brown, Steven Wilder, and Shouyong Peng. (Note, as organizers of the contest, the USeq submission is excluded from any prizes.)</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">The second key aspect of chIP-seq analysis address in this contest is the ability of a chIP-seq detection package to accurately estimate confidence in a given list of candidate binding peaks.  It is of only marginal help to an investigator to provide a ranked list of putative binding peaks without an estimation of where in the rankings the regions become primarily false.  Ideally, a peak detection package should be able to predict what the FDR is for a particular list.  Basically, what % of the regions are false.  FDRs have an unambiguous interpretation and are more useful than p-values for setting confidence thresholds in this type of list based genomic analysis.  The confidence estimation statistic used here is based on the absolute fold difference between the estimated FDR and the actual FDR for lists predicted to contain 1%, 5%, 10%, and 20% false discoveries.  USeq''s and Cisgenome''s empirical FDR estimations scored quite well with an average fold difference of </P>',3405,3405,28,NULL,NULL),
