,(6526,'ENCODE','<P ALIGN=""LEFT"">The <A HREF=""http://www.genome.gov/10005107"" TARGET=""_blank""><B><U>Encyclopedia of DNA Elements (ENCODE) Consortium</U></B></A> is an international collaboration of research groups funded by the National Human Genome Research dbo.gpInstitute (NHGRI). The goal of the consortium is to build a comprehensive parts list of the functional elements of the human genome, including elements that act at the protein level (coding genes) and RNA level (non-coding genes), and regulatory elements that control the cells and circumstances in which a gene is active. The discovery and annotation of gene elements is accomplished primarily by sequencing RNA from a diverse range of sources, comparative genomics, integrative bioinformatic methods, and human curation. Regulatory elements are typically investigated through DNA hypersensitivity assays, assays of DNA methylation, and chromatin immunoprecipitation (ChIP) of proteins that interact with DNA, including modified histones and transcription factors, followed by sequencing (ChIP-Seq). </P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Enclosed datasets were downloaded from the UCSC web site and reformatted, October 2009</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">UCSC&apos;s and ENCODE&apos;s data release policy:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Please observe the following guidelines when using ENCODE data:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Data users may freely use ENCODE data, but may not, without prior consent, submit publications that use an unpublished ENCODE dataset until nine months following the release of the dataset (see time stamp for release date).</P><P ALIGN=""LEFT"">Data users should properly acknowledge the ENCODE Project and resource producer(s) as the source of the data in any publication.</P><P ALIGN=""LEFT"">See the full <B><U>E</U></B><A HREF=""http://www.genome.gov/Pages/Research/ENCODE/ENCODEDataReleasePolicyFinal2008.pdf"" TARGET=""_blank""><B><U>NCODE-modENCODE Data Release Policy (2008-Present)</U></B></A><A HREF=""http://www.genome.gov/Pages/Research/ENCODE/ENCODEDataReleasePolicyFinal2008.pdf"" TARGET=""_blank""> document</A> for further details, and the <A HREF=""http://www.genome.gov/27528022"" TARGET=""_blank""><B><U>ENCODE-modENCODE Data Release Policy</U></B></A><A HREF=""http://www.genome.gov/27528022"" TARGET=""_blank""> </A>description page at NHGRI for background.</P>',3405,3405,28,NULL,NULL)
