,(6541,'Oligo','Oligos: a simple log2(mean T/ mean C) ratio for each oligo in the dataset, the value is assigned to the center of the oligo. Oligo data is typically broken down by chromosome and stored as binary xxx.bar files for viewing in IGB.',6540,3405,7,'dnix','2009-10-12 00:00:00')
,(6542,'TopChIPPeaks','Intervals: Intervals are collapsed overlapping windows and best used for downstream analysis. Several different sets of intervals are created by lowering the pse score threshold to produce the top 100, 200, 400 ... intervals. For each interval set, the following are generated.\r\rBed: a text file representing each interval in the xxx.bed format. Simple start stop. Ranked most significant to least.',6540,3405,7,'dnix','2009-10-12 00:00:00')
,(6543,'WindowPseHM','Windows: several different measurements related to the overlapping window scanning summary statistics. These are best used for visualization in a browser. For each summary score, two types of window representations are given. xxxHM is a window representation best viewed in IGB as a stair step or black and white heatmap. The xxx folder are point window summaries where the window score is assigned to the center position in the window.\r\rPse: all layer pseudomedian relative difference, this is a robust signal estimation and is recommended for ranking and viewing your results. A relative difference is ratio between the difference in intensities and the average intensity (t-c) / ((t+c)/2). Relative differences have proven to be a better transformation than log2.',6540,3405,7,'dnix','2009-10-12 00:00:00')
