,(6573,'Yale TFBS','<P ALIGN=""LEFT"">All information and data were obtained from UCSC <A HREF=""http://genome.ucsc.edu/cgi-bin/hgTrackUi?db=hg18&g=wgEncodeYaleChIPseq"" TARGET=""_blank""><U>http://genome.ucsc.edu/cgi-bin/hgTrackUi?db=hg18&amp;g=wgEncodeYaleChIPseq</U></A></P><P ALIGN=""CENTER""></P><P ALIGN=""CENTER""></P><P ALIGN=""CENTER""><B><U>ENCODE Transcription Factor Binding Sites by ChIP-seq from Yale/UC-Davis/Harvard</U></B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Description</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">This track shows probable binding sites of the specified transcription factors (TFs) in the given cell types as determined by chromatin immunoprecipitation followed by high throughput sequencing (ChIP-Seq). Included for each cell type is the input signal, which represents the control condition where no antibody targeting was performed. For each experiment (cell type vs. antibody) this track shows a graph of enrichment for TF binding (Signal), along with sites that have the greatest evidence of transcription factor binding (Peaks).</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Methods</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Cells were grown according to the approved ENCODE cell culture protocols. Further preparations were similar to those previously published (Euskirchen et al., 2007) with the exceptions that the cells were unstimulated and sodium orthovanadate was omitted from the buffers. For details on the chromatin immunoprecipitation protocol used, see Euskirchen et al. (2007) and Rozowsky et al. (2009).</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">DNA recovered from the precipitated chromatin was sequenced on the Illumina (Solexa) sequencing platform and mapped to the genome using the Eland alignment program. ChIP-seq data was scored based on sequence reads (length ~30 bps) that align uniquely to the human genome. From the mapped tags a signal map of ChIP DNA fragments (average fragment length ~ 200 bp) was constructed where the signal height is the number of overlapping fragments at each nucleotide position in the genome.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">For each 1 Mb segment of each chromosome a peak height threshold was determined by requiring a false discovery rate &lt;= 0.05 when comparing the number of peaks above threshold as compared the number obtained from multiple simulations of a random null background with the same number of mapped reads (also accounting for the fraction of mapable bases for sequence tags in that 1 Mb segment). The number of mapped tags in a putative binding region is compared to the normalized (normalized by correlating tag counts in genomic 10 kb windows) number of mapped tags in the same region from an input DNA control. Using a binomial test, only regions that have a p-value &lt;= 0.05 are considered to be significantly enriched compared to the input DNA control.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Release Notes</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">This is Release 2 (Oct 2009) of this track, which includes data from additional experiments, and the changes described below.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">A number of previously released datasets have been replaced by updated versions. The affected database tables and files include &apos;V2&apos; (or alternatively, &apos;Rel2&apos;) in the name, and metadata is marked with &quot;submittedDataVersion=V2&quot;, followed by the reason for replacement. Specific changes are:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><I>Peaks</I>	 The previously released &quot;Peaks&quot; datasets had an off-by-one start location error and did not include pValues and point peaks. All Peaks data now have these problems corrected.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><I>Signal</I>	 The majority of the previously released &quot;Signal&quot; datasets contained a sparse representation of the signal. These have been corrected to be the continuous signal intended.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">This track contains experiments and data from several labs. During review, it was noticed that the some cell cultures were different enough between the labs that they should be analyzed separatelyÃ?Â¢??using Input specific for the lab. Specifically:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">K562 vs. K562b	 The Farnham lab (UC Davis) K562 cell line variant differs from the Snyder (Yale) and Struhl (Harvard) labs and is now labeled: K562b. Experiments on K562b should be contrasted with Input (UCDavis). The K562 Input previously released has been replaced by two versions marked K562 and K562b. The K562 version used by the Snyder and Struhl groups directly replaces the previous version, and is versioned at V2. The K562b used by the Farnham group is now provided as K562b.</P><P ALIGN=""LEFT"">HepG2 vs. HepG2b	 The Farnham lab HepG2 cell line is now labeled HepG2b. Experiments on HepG2b should be contrasted with Input (UCDavis).</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Credits</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">These data were generated and analyzed by the labs of Michael Snyder, Mark Gerstein and Sherman Weissman at Yale University; Peggy Farnham at UC Davis; and Kevin Struhl at Harvard.    Contact: datasubmission@gersteinlab.org.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>References</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Euskirchen G, Royce TE, Bertone P, Martone R, Rinn JL, Nelson FK, Sayward F, Luscombe NM, Miller P, Gerstein, M et al. CREB binds to multiple loci on human chromosome 22. Mol Cell Biol. 2004 May;24(9):3804-14.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Euskirchen GM, Rozowsky JS, Wei C, Lee WH, Zhang ZD, Hartman S, Emanuelsson O, Stolc V, Weissman S, Gerstein MB et al. Mapping of transcription factor binding regions in mammalian cells by ChIP: comparison of array- and sequencing-based technologies. Genome Res. 2007;17:898-909.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Martone R, Euskirchen G, Bertone P, Hartman S, Royce TE, Luscombe NM, Rinn JL, Nelson FK, Miller P, Gerstein M et al. Distribution of NF-kappaB-binding sites across human chromosome 22. Proc Natl Acad Sci U S A. 2003 Oct;100(21):12247-52.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Robertson G, Hirst M, Bainbridge M, Bilenky M, Zhao Y, Zeng T, Euskirchen G, Bernier B, Varhol R, Delaney A et al. Genome-wide profiles of STAT1 DNA association using chromatin immunoprecipitation and massively parallel sequencing. Nat. Methods 2007;4:651-7.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Rozowsky J, Euskirchen G, Auerbach RK, Zhang ZD, Gibson T, Bjornson R, Carriero N, Snyder M, Gerstein MB. PeakSeq enables systematic scoring of ChIP-seq experiments relative to controls. Nature Biotech. 2009;27:66-75.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Data Release Policy</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Data users may freely use ENCODE data, but may not, without prior consent, submit publications that use an unpublished ENCODE dataset until nine months following the release of the dataset. This date is listed in the Restricted Until column on the track configuration page and the download page. The full data release policy for ENCODE is available here.</P><P ALIGN=""LEFT""></P>',6584,3405,28,'dnix','2009-10-19 00:00:00')
,(6574,'Broad Histone','<P ALIGN=""LEFT"">See -&gt; <A HREF=""http://genome.ucsc.edu/cgi-bin/hgTrackUi?db=hg18&g=wgEncodeBroadChipSeq"" TARGET=""_blank""><B><U>ENCODE Histone Modifications by Broad dbo.gpInstitute ChIP-seq</U></B></A></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Data version:</B> ENCODE Feb 2009 Freeze</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Description:</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">These track displays maps of chromatin state generated by the Broad/MGH ENCODE group using ChIP-seq. Chemical modifications (methylation, acylation) to the histone proteins present in chromatin influence gene expression by changing how accessible the chromatin is to transcription.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">The ChIP-seq method involves cross-linking histones and other DNA associated proteins to genomic DNA within cells using formaldehyde. The cross-linked chromatin is subsequently extracted, mechanically sheared, and immunoprecipitated using specific antibodies. After reversal of cross-links, the immunoprecipitated DNA is sequenced and mapped to the human reference genome. The relative enrichment of each antibody-target (epitope) across the genome is inferred from the density of mapped fragments.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Credits:</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">The ChIP-seq data were generated at the Broad dbo.gpInstitute and in the Bradley E. Bernstein lab at the Massachusetts General Hospital/Harvard Medical School.    Contact: nshoresh@broad.mit.edu.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Data generation and analysis was supported by funds from the NHGRI, the Burroughs Wellcome Fund, Massachusetts General Hospital and the Broad Institute.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>References:</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Bernstein BE, Kamal M, Lindblad-Toh K, Bekiranov S, Bailey DK, Huebert DJ, McMahon S, Karlsson EK, Kulbokas EJ, Gingeras TR et al. Genomic maps and comparative analysis of histone modifications in human and mouse. Cell. 2005 Jan 28;120(2):169-81.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Bernstein BE, Mikkelsen TS, Xie X, Kamal M, Huebert DJ, Cuff J, Fry B, Meissner A, Wernig M, Plath K et al. A bivalent chromatin structure marks key developmental genes in embryonic stem cells. Cell. 2006 Apr 21;125(2):315-26.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Mikkelsen TS, Ku M, Jaffe DB, Issac B, Lieberman E, Giannoukos G, Alvarez P, Brockman W, Kim T, Koche RP et al. Genome-wide maps of chromatin state in pluripotent and lineage-committed cells. Nature. 2007 Aug 2;448:553-60.</P><P ALIGN=""LEFT""></P>',6584,3405,28,'dnix','2009-10-19 00:00:00')
,(6575,'SUNY RBP','<P ALIGN=""LEFT""><A HREF=""http://hgdownload.cse.ucsc.edu/goldenPath/hg18/encodeDCC/wgEncodeSunyalbanyRnaGeneChip/"" TARGET=""_blank""><B><U>ENCODE SUNY Albany RNA Binding Proteins by RIP-chip</U></B></A></P>',6584,3405,28,'dnix','2009-10-19 00:00:00')
,(6578,'RIKEN CAGE Loc','<P ALIGN=""LEFT""><A HREF=""http://genome.ucsc.edu/cgi-bin/hgTrackUi?db=hg18&g=wgEncodeRikenCage"" TARGET=""_blank""><B><U>ENCODE RIKEN RNA Subcellular Localization by CAGE Tags</U></B></A></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Description</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">This track shows 5&apos; cap analysis gene expression (CAGE) tags and clusters in RNA extracts from different sub-cellular localizations in multiple cell lines. A CAGE cluster is a region of overlapping tags with an assigned value that represents the expression level. The data in this track were produced as part of the ENCODE Transcriptome Project.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>These tracks contains the following views:</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><I>Plus and Minus Clusters</I> - These views display clusters of overlapping read mappings on the forward and reverse genomic strands.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Methods</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Cells were grown according to the approved ENCODE cell culture protocols. RNA molecules longer than 200 nt and present in the RNA population isolated from each subcellular compartment were fractionated into polyA+ and polyA- fractions as described in these protocols. The CAGE tags were sequenced from the 5&apos; ends of cap-trapped cDNAs produced using RIKEN CAGE technology (Kodzius et al. 2006; Valen et al. 2009). To create the tag, a linker was attached to the 5&apos; end of polyA+ or polyA- reverse-transcribed cDNAs which were selected by cap trapping (Carninci et al. 1996). The first 27 bp of the cDNA were cleaved using class II restriction enzymes. A linker was then attached to the 3&apos; end of the cDNA.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">After PCR amplification, the tags were sequenced (36 bp single reads) using ABI SOLiD technology (polyA- RNA from the cytosol and nucleus of K562 cell lines, and from whole cell in prostate cells) or Illumina/Solexa GA (all other data). Tags were mapped to the human genome (NCBI Build36, hg18) using the program nexalign (T. Lassmann manuscript in preparation). SOlid CAGE sequences were mapped with up to 3 mismatches; 2 mismatches were allowed for Solexa CAGE. Alignments of sequences mapping 10 times or fewer were retained. The expression level was computed as the number of reads making up the cluster, divided by the total number of reads sequenced, times 1 million.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Credits</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">These data were generated and analyzed by Timo Lassmann, Phil Kapranov, Hazuki Takahashi, Yoshihide Hayashizaki, Carrie Davis, Tom Gingeras, and Piero Carninci.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Contact:</B> Piero Carninci at RIKEN Omics Science Center</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>References</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Kodzius R, Kojima M, Nishiyori H, Nakamura M, Fukuda S, Tagami M, Sasaki D, Imamura K, Kai C, Harbers M, et al. CAGE: cap analysis of gene expression. Nat Methods. 2006 March 1; 3(3):211-222.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Valen E, Pascarella G, Chalk A, Maeda N, Kojima M, Kawazu C, Murata M, Nishiyori H, Lazarevic D, Motti D, et al. Genome-wide detection and analysis of hippocampus core promoters using DeepCAGE. Genome Res. 2009 February; 19(2):255-265.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Carninci P, Kvam C, Kitamura A, Ohsumi T, Okazaki Y, Itoh M, Kamiya M, Shibata K, Sasaki N, Izawa M, et al. High-efficiency full-length cDNA cloning by biotinylated CAP trapper. Genomics. 1996 November 1; 37(3):327-336.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Data Release Policy</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Data users may freely use ENCODE data, but may not, without prior consent, submit publications that use an unpublished ENCODE dataset until nine months following the release of the dataset. This date is listed in the Restricted Until column on the track configuration page and the download page. The full data release policy for ENCODE is available <A HREF=""http://genome.cse.ucsc.edu/ENCODE/terms.html"" TARGET=""_blank""><U>here.</U></A></P>',6584,3405,28,'dnix','2009-10-19 00:00:00')
,(6579,'Open Chromatin','<P ALIGN=""LEFT""><A HREF=""http://genome.ucsc.edu/cgi-bin/hgTrackUi?db=hg18&g=wgEncodeChromatinMap"" TARGET=""_blank""><B><U>ENCODE Open Chromatin Map by the Crawford/Duke, Leib/UNC and Iyer/UT-Austin labs</U></B></A></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Description</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">These tracks display evidence of open chromatin in multiple cell types from the Duke/UNC/UT-Austin/EBI ENCODE group. Open chromatin was identified using two independent and complementary methods: DNaseI hypersensitivity (HS) and Formaldehyde-Assisted Isolation of Regulatory Elements (FAIRE), combined with chromatin immunoprecipitation (ChIP) for select regulatory factors. Each method was verified by two detection platforms: Illumina (formerly Solexa) sequencing by synthesis, and high-resolution 1% ENCODE tiled microarrays supplied by NimbleGen.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>DNaseI HS data:</B> DNaseI is an enzyme that has long been used to map general chromatin accessibility, and DNaseI &quot;hyperaccessibility&quot; or &quot;hypersensitivity&quot; is a feature of active cis-regulatory sequences. The use of this method has led to the discovery of functional regulatory elements that include enhancers, silencers, insulators, promotors, locus control regions and novel elements. DNaseI hypersensitivity signifies chromatin accessibility following binding of trans-acting factors in place of a canonical nucleosome.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>FAIRE data:</B> FAIRE (Formaldehyde Assisted Isolation of Regulatory Elements) is a method to isolate and identify nucleosome-depleted regions of the genome. FAIRE was initially discovered in yeast and subsequently shown to identify active regulatory elements in human cells (Giresi et al., 2007). Although less well-characterized than DNase, FAIRE also appears to identify functional regulatory elements that include enhancers, silencers, insulators, promotors, locus control regions and novel elements. DNA fragments isolated by FAIRE are 100-200 bp in length, with the average length being 140 bp.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>ChIP data:</B> ChIP (Chromatin Immunoprecipitation) is a method to identify the specific location of proteins that are directly or indirectly bound to genomic DNA. By identifying the binding location of sequence-specific transcription factors, general transcription machinery components, and chromatin factors, ChIP can help in the functional annotation of the open chromatin regions identified by DNaseI HS mapping and FAIRE.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Display Conventions and Configuration</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Peaks</B></P><P ALIGN=""LEFT"">Regions of enriched signal in either DNaseI HS, FAIRE, or ChIP experiments. Peaks were called based on signals created using F-Seq, a software program developed at Duke (Boyle et al., 2008b). Significant regions were determined by performing ROC analysis of sequence data using data from the 1% ENCODE arrays, and determining a cut-off value at approximately the 95% sensitivity level. The solid vertical line in the peak represents the point with highest signal. ENCODE Peaks tables contain a p-value for statistical significance. For these data, this was determined by fitting the data to a gamma distribution.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Signal (F-Seq Density)</B></P><P ALIGN=""LEFT"">Density graph (wiggle) of signal enrichment calculated using F-Seq for the combined set of sequences from all replicates. F-Seq employs Parzen kernel density estimation to create base pair scores (Boyle et al., 2008b). This method does not look at fixed-length windows but rather weights contributions of nearby sequences in proportion to their distance from that base. It only considers sequences aligned 4 or less times in the genome, and uses an alignability background model to try to correct for regions where sequences cannot be aligned. For the K562, HepG2 and HelaS3 cell types, where there is an abnormal karyotype, a model to try to correct for amplifications and deletions was also used. No control data were used in the creation of these annotations.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Signal (Base Overlap)</B></P><P ALIGN=""LEFT"">An alternative version of the Signal (F-Seq Density) track annotation that provides a higher resolution view of the raw sequence data. This track also includes the combined set of sequences from all replicates. For each sequence, the aligned read is extended in the following way: for DNase, the read is extended 5 bp in both directions from its 5&apos; aligned end where DNase cut the DNA; for FAIRE and ChIP, the sequence is extend to a fragment length of 134 bp from the 5&apos; aligned end representing the approximate average fragment length. The score at each base pair represents the number of extended fragments that overlap the base pair.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Uniqueness</B></P><P ALIGN=""LEFT"">The Duke uniqueness tracks were used in identify regions of unique sequence for different tag lengths. The tracks also identify regions where high-throughput sequence tags cannot be mapped.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Excluded Regions</B></P><P ALIGN=""LEFT"">The Duke excluded regions track was used to identify problematic regions for short sequence tag signal detection (such as satellites and rRNA genes). These regions of the genome were excluded from the Open Chromatin tracks.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Methods</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Cells were grown according to the approved ENCODE cell culture protocols.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">DNaseI hypersensitive sites were isolated using methods called DNase-seq or DNase-chip (Boyle et al., 2008a, Crawford et al., 2006). Briefly, cells were lysed with NP40, and intact nuclei were digested with optimal levels of DNaseI enzyme. DNaseI digested ends were captured from three different DNase concentrations, and material was sequenced using Illumina (Solexa) sequencing. DNase-seq data were verified using material that was hybridized to NimbleGen Human ENCODE tiling arrays (1% of the genome). Multiple independent growths (replicates) were compared to verify the reproducibility of the data. A more detailed protocol is available here.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">FAIRE was performed (Giresi et al., 2007) by cross-linking proteins to DNA using 1% formaldehyde solution, and the complex was sheared using sonication. Phenol/chloroform extractions were performed to remove DNA fragments cross-linked to protein. The DNA recovered in the aqueous phase was hybridized to NimbleGen Human ENCODE tiling arrays (1% of the genome) and sequenced using a Solexa sequencing system. The ENCODE array data were used to verify the accuracy of the sequencing data, and multiple independent growths (replicates) were compared to assess the reproducibility of the data. A more detailed protocol is available here. Also see Giresi et al., 2009.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">To perform ChIP, proteins were cross-linked to DNA in vivo using 1% formaldehyde solution (Bhinge et al., 2007, ENCODE Project Consortium., 2007). Cross-linked chromatin was sheared by sonication and immunoprecipitated using a specific antibody against the protein of interest. After reversal of the cross-links, the immunoprecipitated DNA was used to identify the genomic location of transcription factor binding. This was accomplished by Solexa sequencing of the ends of the immunoprecipitated DNA (ChIP-seq), as well as labeling and hybridization of the immunoprecipitated DNA to NimbleGen Human ENCODE tiling arrays (1% of the genome) along with the input DNA as reference (ChIP-chip). The ENCODE array data were used to verify the accuracy of the sequencing data, and multiple independent growths (replicates) were compared to assess the reproducibility of the data. A more detailed protocol is available here.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">ENCODE Array data were normalized using the Tukey biweight normalization, and peaks were called using ChIPOTle (Buck, et al., 2005) at multiple levels of significance. Regions matched on size to these peaks that were devoid of any significant signal were also created to allow for ROC analysis.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Sequences from each experiment were aligned to the genome using Maq (Li et al., 2008) and those that aligned to 4 or fewer locations were retained. Other sequences were also filtered based on their alignment to problematic regions (such as satellites and rRNA genes). The resulting digital signal was converted to a continuous wiggle track using F-Seq that employs Parzen kernel density estimation to create base pair scores (Boyle et al., 2008b). Discrete DNase HS, FAIRE, and ChIP sites (peaks) were identified from DNase/FAIRE/ChIP-seq using F-Seq by setting a Parzen cutoff based on ROC curve analysis using peaks and non-peaks identified from DNase/FAIRE/ChIP-chip using NimbleGen Human ENCODE tiling arrays (1% of the genome).</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Input data was generated for GM12878, K562, HeLa-S3, HepG2, and HUVEC. These were used directly to create a control/background model used for F-Seq when generating signal annotations and subsequenntly peaks for these cell lines. These models are meant to correct for sequencing biases, alignment artifacts, and copy number changes in these cell lines. Input data is not being generated directly for other cell lines. Instead, a general background model was derived from the five Input data sets. This should provide corrections for sequencing biases and alignment artifacts, but obviously not for cell type specific copy number changes.</P>',6584,3405,28,'dnix','2009-10-19 00:00:00')
,(6580,'Affy RNA Loc','<P ALIGN=""LEFT""><A HREF=""http://genome.ucsc.edu/cgi-bin/hgTrackUi?db=hg18&g=wgEncodeAffyRnaChip"" TARGET=""_blank""><B><U>ENCODE Affymetrix/CSHL Subcellular RNA Localization by Tiling Array</U></B></A></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Description</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">This track is produced as part of the ENCODE Transcriptome Project. Transcription of different RNA extracts from different sub-cellular localizations in different cell lines is compared in companion experiments using three different technologies: tiling arrays, RNA-seq using Solexa, and RNA-seq using SOLiD. The tiling array data are shown in this track. The Raw Signal view shows an estimate of abundance of RNA molecules and the Transfrags view shows the locations of sites corresponding to these molecules.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Display Conventions and Configuration</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Transfrags</P><P ALIGN=""LEFT"">The Transfrags view includes all transfrags before filtering.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Raw Signal</P><P ALIGN=""LEFT"">The Raw Signal view shows the probe intensity based on all probes.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Methods</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Cells were grown according to the approved ENCODE cell culture protocols. RNA molecules longer than 200 nt and present in RNA population isolated from different subcellular compartments (such as cytosol, nucleus, polysomes and others) were fractionated into polyA+ and polyA- fractions as described in these protocols. Each RNA fraction was converted into double-stranded cDNA using random hexamers, labeled and hybridized to a tiling 91-array set containing probes against the non-repetitive portion of the human genome tiled on average every 5 bp (center-to-center of each consecutive 25-mers).</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">All arrays were scaled to a median array intensity of 330. Within a sliding 61 bp window centered on each probe, an estimate of RNA abundance (signal; see the Raw Signal view) was found by calculating the median of all pairwise average PM-MM values, where PM is a perfect match and MM is a mismatch. Kapranov et al. (2002), Cheng et al. (2005) , Kapranov et al. (2007), and Cawley et al. (2004) are good references for the experimental methods. Cawley et al. also describes the analytical methods.</P><P ALIGN=""LEFT""><B></B></P><P ALIGN=""LEFT""><B>Verification</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">The reproducibility of the labeling method was assessed separately. Three independent technical replicates were generated from the same RNA pool for each RNA preparation and hybridized to duplicate arrays (two technical replicates) that contain the ENCODE regions. Labeled RNA samples were then pooled and hybridized to the tiling 91-array set spanning the whole genome. Transcribed regions (transfrags; see the Transfrags view) were generated from the Raw Signal by merging genomic positions to which probes are mapped. This merging was based on a 5% false positive rate cutoff in negative bacterial controls, a maximum gap (MaxGap) of 40 base-pairs and minimum run (MinRun) of 40 base-pairs.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Credits</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">These data were generated and analyzed by the transcriptome group at Affymetrix and Cold Spring Harbor Laboratories: P. Kapranov, I. Bell, E. Dumais, J. Drenkow, J. Dumais, N. Garg, M. Lubinsky, Carrie A. Davis, Huaien Wang, Kimberly Bell, Jorg Drenkow, Chris Zaleski, and Thomas R. Gingeras. </P><P ALIGN=""LEFT"">Contact: gingeras@cshl. edu (Tom Gingeras)</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>References</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Cawley S, Bekiranov S, Ng HH, Kapranov P, Sekinger EA, Kampa D, Piccolboni A, Sementchenko V, Cheng J, Williams AJ et al. Unbiased mapping of transcription factor binding sites along human chromosomes 21 and 22 points to widespread regulation of noncoding RNAs. Cell. 2004 Feb 20;116(4):499-509.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Cheng J, Kapranov P, Drenkow J, Dike S, Brubaker S, Patel S, Long J, Stern D, Tammana H, Helt G et al. Transcriptional Maps of 10 Human Chromosomes at 5 Nucleotide Resolution. Science. 2005 May 20;308(5725):1149-1154.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Kapranov P, Cawley SE, Drenkow J, Bekiranov S, Strausberg RL, Fodor SP, Gingeras TR. Large-scale transcriptional activity in chromosomes 21 and 22. Science. 2002 May 3;296(5569):916-9.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Kapranov P, Cheng J, Dike S, Nix DA, Duttagupta R, Willingham AT, Stadler PF, Hertel J, HackermÃ??Ã?Â¼ller J, Hofacker IL, et al. RNA maps reveal new RNA classes and a possible function for pervasive transcription. Science. 2007 Jun 8;316(5830):1484-8.</P><P ALIGN=""LEFT""></P>',6584,3405,28,'dnix','2009-10-19 00:00:00')
,(6583,'UW DNaseI HS','<P ALIGN=""LEFT""><A HREF=""http://genome.ucsc.edu/cgi-bin/hgTrackUi?db=hg18&g=wgEncodeUwDnaseSeq"" TARGET=""_blank""><B><U>ENCODE Univ. Washington DNaseI Hypersensitivity by Digital DNaseI</U></B></A><B><U></U></B></P><P ALIGN=""LEFT""><B><U></U></B></P><P ALIGN=""LEFT""><B>Description</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">This track is produced as part of the ENCODE Project. This track shows DNaseI sensitivity measured genome-wide in different cell lines using the Digital DNaseI methodology (see below), and DNaseI hypersensitive sites. DNaseI has long been used to map general chromatin accessibility and DNaseI hypersensitivity is a universal feature of active cis-regulatory sequences. The use of this method has led to the discovery of functional regulatory elements that include enhancers, insulators, promotors, locus control regions and novel elements. For each experiment (cell type) this track shows DNaseI hypersensitive zones (HotSpots) and hypersensitive sites (Peaks) based on the sequencing tag density (Signal).</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Display Conventions and Configuration</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">For each cell type, this track contains the following views:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><I>HotSpots</I> - DNaseI hypersensitive zones identified using the HotSpot algorithm.</P><P ALIGN=""LEFT""><I>Peaks</I> - DNaseI hypersensitive sites (DHSs) identified as signal peaks within FDR 0.5% hypersensitive zones.</P><P ALIGN=""LEFT""><I>Raw Signal</I> - Density graph of signal enrichment based on aligned read density.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">DNaseI sensitivity is shown as the absolute density of in vivo cleavage sites across the genome mapped using the Digital DNaseI methodology (see below). Data have been normalized to 25 million reads per cell type.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Methods</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Cells were grown according to the approved ENCODE cell culture protocols. Digital DNaseI was performed by performing DNaseI digestion of intact nuclei, isolating DNaseI &apos;double-hit&apos; fragments as described in Sabo et al. (2006), and direct sequencing of fragment ends (which correspond to in vivo DNaseI cleavage sites) using the Solexa platform (27 bp reads). Uniquely mapping high-quality reads were mapped to the genome. DNaseI sensitivity is directly reflected in raw tag density (Signal), which is shown in the track as density of tags mapping within a 150 bp sliding window (at a 20 bp step across the genome). DNaseI hypersensitive zones (HotSpots) were identified using the HotSpot algorithm described in Sabo et al. (2004). 0.5% false discovery rate thresholds (FDR 0.005) were computed for each cell type by applying the HotSpot algorithm to an equivalent number of random uniquely mapping 27mers. DNaseI hypersensitive sites (DHSs or Peaks) were identified as signal peaks within FDR 0.5% hypersensitive zones using a peak-finding algorithm.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Verification</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Data were verified by sequencing biological replicates displaying correlation coefficient &gt;0.9. Results are extensively validated by conventional DNaseI hypersensitivity assays using end-labeling/Southern blotting methods.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Credits</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">These data were generated by the UW ENCODE group.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Contact: Richard Sandstrom</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>References</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Sabo PJ, Kuehn MS, Thurman R, Johnson BE, Johnson EM, Cao H, Yu M, Rosenzweig E, Goldy J, Haydock A et al. Genome-scale mapping of DNase I sensitivity in vivo using tiling DNA microarrays Nature Methods. 2006 Jul;3(7):511-8.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Sabo PJ, Hawrylycz M, Wallace JC, Humbert R, Yu M, Shafer A, Kawamoto J, Hall R, Mack J, Dorschner M et al. Discovery of functional noncoding elements by digital analysis of chromatin structure. PNAS. 2004 Nov 30;101(48):16837-42.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""><B>Data Release Policy</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Data users may freely use ENCODE data, but may not, without prior consent, submit publications that use an unpublished ENCODE dataset until nine months following the release of the dataset. This date is listed in the Restricted Until column, above. The full data release policy for ENCODE is available <A HREF=""http://genome.ucsc.edu/ENCODE/terms.html"" TARGET=""_blank""><B><U>here.</U></B></A></P>',6584,3405,28,'dnix','2009-10-19 00:00:00')
