,(6614,'Peaks','<P ALIGN=""LEFT"">ChIP-Seq Peak calls</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Regions of signal enrichment based on processed data (usually normalized data from pooled replicates). ENCODE Peaks tables contain fields for statistical significance. Peaks for this track include a signalValue and pValue. The signalValue represents the fold enrichment of reads across the length of the interval, relative to random expectation. The pValue reflects the likelihood of observing an interval of the given length and signalValue at random. A long interval with a moderate signalValue and a short interval with a high signalValue can therefore have the same pValue.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Converted from broadPeak format to useq format using the <A HREF=""http://useq.sourceforge.net/cmdLnMenus.html#Text2USeq"" TARGET=""_blank""><U>Text2USeq</U></A> app (java -jar -Xmx4G ~/USeqApps/Text2USeq -g H_sapiens_Mar_2006 -f . -c 0 -b 1 -e 2 -v 7)</P>',6574,3405,28,'u0028003','2009-12-30 00:00:00')
