,(6651,'PEA3','<P ALIGN=""LEFT"">Processing of Pete&apos;s human data hg18 6652R by Nix</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">ETV4 IP from PC3 cells (experimental) and two lanes of PC3 input (control).</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">java -jar -Xmx4G ~/USeqApps/ElandParser -v H_sapiens_Mar_2006 -f Input </P><P ALIGN=""LEFT"">java -jar -Xmx4G ~/USeqApps/ElandParser -v H_sapiens_Mar_2006 -f ChIP</P><P ALIGN=""LEFT"">java -jar -Xmx4G ~/USeqApps/FilterPointData -p Input/PointData0bp/,ChIP/PointData0bp/ -r /home/Annotation/Human/Hg18/Repeats/hg18Satellite.bed.gz</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">jj ~/USeqApps/PointDataManipulator -i -o -p PointData0bp_hg18Satellite.bed_Filt0bp/ -s DupSatFilt_ChIP_PointData</P><P ALIGN=""LEFT"">8044384	Number starting reads</P><P ALIGN=""LEFT"">7118901	Number collapsed reads</P><P ALIGN=""LEFT"">0.885	Fraction unique reads</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">jj ~/USeqApps/PointDataManipulator -i -o -p PointData0bp_hg18Satellite.bed_Filt0bp/ -s DupSatFilt_Input_PointData</P><P ALIGN=""LEFT"">14747797	Number starting reads</P><P ALIGN=""LEFT"">13612598	Number collapsed reads</P><P ALIGN=""LEFT"">0.923	Fraction unique reads</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">jj ~/USeqApps/PeakShiftFinder -s ../PeakShiftFinder -t ../ChIP/DupSatFilt_ChIP_PointData/ -c DupSatFilt_Input_PointData/</P><P ALIGN=""LEFT"">Calculating composite shift...</P><P ALIGN=""LEFT"">	499	5&apos; Peak</P><P ALIGN=""LEFT"">	752	3&apos; Peak</P><P ALIGN=""LEFT"">	253	Composite peak shift</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Calculating individual peak shifts for top 81...</P><P ALIGN=""LEFT"">	286	Median peak shift</P><P ALIGN=""LEFT"">	294	Mean peak shift</P><P ALIGN=""LEFT"">	75.0	Stnd dev peak shifts</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Going with 253 + 75 = 328 -&gt; 330, kind of on the large size?!</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">jj ~/USeqApps/ScanSeqs -p 330 -q -s PetesPEA3 -t ../../SeqData/PetesData/ChIP/DupSatFilt_ChIP_PointData/ -c ../../SeqData/PetesData/Input/DupSatFilt_Input_PointData/ </P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Arguments: -p 330 -q -s PetesPEA3 -t ../../SeqData/PetesData/ChIP/DupSatFilt_ChIP_PointData/ -c ../../SeqData/PetesData/Input/DupSatFilt_Input_PointData/</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Scanning for enriched regions...</P><P ALIGN=""LEFT"">	2	Minium number reads in window</P><P ALIGN=""LEFT"">	330	Peak shift</P><P ALIGN=""LEFT"">	330	Window size</P><P ALIGN=""LEFT"">Calculating read count stats and binomial p-value look up tables...</P><P ALIGN=""LEFT"">	7118893	Treatment Observations</P><P ALIGN=""LEFT"">	13612589	Control Observations</P><P ALIGN=""LEFT"">	</P><P ALIGN=""LEFT"">jj ~/USeqApps/EnrichedRegionMaker -f PetesPEA3/ -s 20,20,1 -i 1,2,4</P><P ALIGN=""LEFT"">Processing windowData330bp.swi...</P><P ALIGN=""LEFT"">	330	Max gap </P><P ALIGN=""LEFT"">	Thresholds:</P><P ALIGN=""LEFT"">	20.0	QValueFDR score threshold</P><P ALIGN=""LEFT"">	20.0	EmpFDR score threshold</P><P ALIGN=""LEFT"">	1.0	Log2((sumT+1)/(sumC+1)) score threshold</P><P ALIGN=""LEFT"">	2934	Enriched Regions created</P><P ALIGN=""LEFT"">	</P><P ALIGN=""LEFT"">	</P><P ALIGN=""LEFT"">jj ~/USeqApps/ReadCoverage -s ReadCoverage/PEA3ChIP -p ChIP/DupSatFilt_ChIP_PointData/</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Used UCSC&apos;s liftover tool to convert 2934 ers to mm9 coordinates, lost 600.</P>',6528,3405,13,'u0028003','2010-02-24 00:00:00')
