,(6679,'Helicose RNA Seq','<P ALIGN=""LEFT""><B>See </B><A HREF=""http://genome.ucsc.edu/cgi-bin/hgTrackUi?db=hg18&g=wgEncodeHelicosRnaSeq"" TARGET=""_blank""><B><U>http://genome.ucsc.edu/cgi-bin/hgTrackUi?db=hg18&amp;g=wgEncodeHelicosRnaSeq</U></B></A><B></B></P><P ALIGN=""LEFT""><B></B></P><P ALIGN=""LEFT""><B>Description</B></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">This track depicts high throughput sequencing of long RNAs (&gt;200 nt) from whole cell RNA samples from tissues or sub cellular compartments from cell lines included in the ENCODE Transcriptome subproject. The overall goal of the ENCODE project is to identify and characterize all functional elements in the sequence of the human genome. RNA-Seq was performed by reverse-transcribing an RNA sample into cDNA, followed by high throughput DNA sequencing of the cDNA, which was done here on Helicosâ?¢ Genetic Analysis System (Harris et al; http://www.helicosbio.com/).</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Display Conventions and Configuration</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Raw Signal</P><P ALIGN=""LEFT"">Density graph (wiggle) of the number of reads overlapping a nucleotide in the genome.</P><P ALIGN=""LEFT"">To show only selected subtracks, uncheck the boxes next to the tracks that you wish to hide. Color differences among the views are arbitrary. They provide a visual cue for distinguishing between the different cell types and compartments.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Note that the strand of the RNA is not displayed in the track in the genome browser. The strand can be found in the download file.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Methods</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Cells were grown according to the approved ENCODE cell culture protocols. RNA molecules longer than 200 nt and present in RNA population isolated from different subcellular compartments (such as cytosol, nucleus, polysomes and others) were fractionated into polyA+ and polyA- fractions as described in these protocols.</P><P ALIGN=""LEFT"">RNA was converted into first strand cDNA using a high excess of random hexamers without prior fragmentation. Spurious second-strand cDNA synthesis could occur under these conditions. The first strand cDNA molecules were tailed at the 3â?² ends with polyA residues using terminal transferase and used directly for sequencing.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Filtered reads were aligned to the human genome using in-house and freely available Helicos Alignment software indexDPgenomic (http://open.helicosbio.com/mwiki/index.php/Docs/Software/Bioinformatics#Executables, requires registration (free)) with a minimum normalized alignment score of 4.5. The normalized score was defined as following:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Score=(#matches*5-#mismatches*4)/length_read</P><P ALIGN=""LEFT"">For example, in the following alignment:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Tag Sequence CCTCCGTGTTGTTCCAGCC-CAGTGCTCGCAGG </P><P ALIGN=""LEFT"">Ref Sequence C-TCCGTGTTGTTCCAGCCACAGTGCTCGCAGG</P><P ALIGN=""LEFT"">Length of alignment block: 33</P><P ALIGN=""LEFT"">Length of tag sequence: 32</P><P ALIGN=""LEFT"">Number of matches: 31</P><P ALIGN=""LEFT"">Number of errors: 2</P><P ALIGN=""LEFT"">Score: (31*5) - (2*4) = 155 - 8 = 147</P><P ALIGN=""LEFT"">Normalized score = 147/32 = 4.59375</P><P ALIGN=""LEFT"">Raw data can be found at Helicos (requires registration (free)).</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Verification</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Known exon maps as displayed on the genome browser are confirmed by the alignment of sequence reads.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Credits</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Helicos BioSciences: Philipp Kapranov, Eldar Giladi, Steve Roels, Chris Hart, Stan Letovsky, Patrice Milos.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Cold Spring Harbor Laboratory: Carrie Davis, Kim Bell, Huaien Wang, Tom Gingeras.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Contacts: Philipp Kapranov ; Patrice Milos</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">References</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Harris TD, Buzby PR, Babcock H, Beer E, Bowers J, Braslavsky I, Causey M, Colonell J, Dimeo J, Efcavitch JW, Giladi E, Gill J, Healy J, Jarosz M, Lapen D, Moulton K, Quake SR, Steinmann K, Thayer E, Tyurina A, Ward R, Weiss H, Xie Z. Single-molecule DNA sequencing of a viral genome Science. 2008 Apr 4;320(5872):106-9</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Data Release Policy</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Data users may freely use ENCODE data, but may not, without prior consent, submit publications that use an unpublished ENCODE dataset until nine months following the release of the dataset. This date is listed in the Restricted Until column, above. The full data release policy for ENCODE is available here.</P><P ALIGN=""LEFT""></P>',6584,3405,28,'u0028003','2010-03-24 00:00:00')
