,(6714,'RNA-Seq Challenge','<P ALIGN=""LEFT"">Source of RNA seq data:</P><P ALIGN=""LEFT"">	50M aligned reads from a human platelet and megakaryocyte unstranded paired RNA-Seq experiment (Weyrich Lab)</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Spike-in generation:</P><P ALIGN=""LEFT"">	Randomly selected 500 non-intersecting genes with &gt; 20 reads </P><P ALIGN=""LEFT"">	Randomized and split the 50M reads into 3rds</P><P ALIGN=""LEFT"">	For each of the 3rds, split the reads into a treatment and control group</P><P ALIGN=""LEFT"">		For the selected 500 genes, skewed the read distribution between 0.2-0.45 and 0.55-0.8 (the skew was selected once and applied to all 3rds)</P><P ALIGN=""LEFT"">		For other mapped reads those falling within each gene were assigned to either group using a randomly selected skewed distribution 0.45-0.55</P><P ALIGN=""LEFT"">	Yields an Overdispersed dataset with 3 treatment and 3 control replicas</P>',6371,6300,28,'u0028003','2010-04-27 00:00:00')
