,(6720,'Read Coverage','<P ALIGN=""LEFT"">Reprocessed data tracks</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">#for small RNA-seq gave funky format, first had to strip out reads with more than three matches</P><P ALIGN=""LEFT"">gunzip -c smrna_h1.gz | awk &apos;$8 &lt;= 3&apos; &gt; smrna_h1_Max3.txt</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">#convert to point data</P><P ALIGN=""LEFT"">for x in $(ls); do java -jar -Xmx2G ~/Software/USeq_6.2/Apps/Tag2Point -v H_sapiens_Mar_2006 -i 3 -b -c -f $x; done</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">#read coverage</P><P ALIGN=""LEFT"">for x in mRNA_H1_Point mRNA_IMR90_Point smRNA_H1_Point smRNA_IMR90_Point; do java -jar -Xmx2G ~/Software/USeq_6.2/Apps/ReadCoverage -p $x -s ReadCoverage/$x ; done</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">See <A HREF=""https://hci-as1.hci.utah.edu/gnomex/gnomexFlex.jsp?launchWindow=AnalysisDetail&analysisNumber=A103&isGuest=Y"" TARGET=""_blank""><B><U>https://hci-as1.hci.utah.edu/gnomex/gnomexFlex.jsp?launchWindow=AnalysisDetail&amp;analysisNumber=A103&amp;isGuest=Y</U></B></A></P>',6719,3405,7,'u0028003','2010-05-04 00:00:00')
,(6721,'CSHL Sm RNA-seq','<P ALIGN=""LEFT"">Data was downloaded and in some cases reprocessed from <A HREF=""http://genome.ucsc.edu/cgi-bin/hgTrackUi?db=hg18&g=wgEncodeCshlShortRnaSeq"" TARGET=""_blank""><B><U>http://genome.ucsc.edu/cgi-bin/hgTrackUi?db=hg18&amp;g=wgEncodeCshlShortRnaSeq</U></B></A> and <A HREF=""http://hgdownload.cse.ucsc.edu/goldenPath/hg18/encodeDCC/wgEncodeCshlShortRnaSeq/"" TARGET=""_blank""><B><U>http://hgdownload.cse.ucsc.edu/goldenPath/hg18/encodeDCC/wgEncodeCshlShortRnaSeq/</U></B></A></P>',6584,3405,28,'u0028003','2010-05-04 00:00:00')
,(6722,'Read Coverage','<P ALIGN=""LEFT"">xxx.tagAlign.gz files were downloaded from UCSC and reprocessed into ReadCoverage tracks using the USeq Tag2Point and ReadCoverage applications</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">for x in $(ls *gz); do echo $x; java -jar -Xmx2G ~/Software/USeq_6.2/Apps/Tag2Point -v H_sapiens_Mar_2006 -f $x; done</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">for x in $(ls); do echo $x; java -jar -Xmx2G ~/Software/USeq_6.2/Apps/ReadCoverage -p $x -s ../ReadCoverage/$x; done</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">java -jar -Xmx2G ~/Software/USeq_6.2/Apps/Bar2USeq -f ReadCoverage/ -e</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">See <A HREF=""https://hci-as1.hci.utah.edu/gnomex/gnomexFlex.jsp?launchWindow=AnalysisDetail&analysisNumber=A103&isGuest=Y"" TARGET=""_blank""><B><U>https://hci-as1.hci.utah.edu/gnomex/gnomexFlex.jsp?launchWindow=AnalysisDetail&amp;analysisNumber=A103&amp;isGuest=Y</U></B></A></P>',6721,3405,28,'u0028003','2010-05-04 00:00:00')
