,(6815,'7397X1','<P ALIGN=""LEFT"">100819</P><P ALIGN=""LEFT"">#Ran novoalign for smRNA</P><P ALIGN=""LEFT"">nohup /home/BioApps/novocraft/novoalign -FILMFQ -m -l17 -h90 -t30 -rA 15 -q 3 -d /home/Genomes/Human/Hg18/novo_index/hg18WithSplicesAdaptersk13s3 -a ATCTCGTATGCCGTCTTCTGCTTG -f ~/BioAnalysis/Sue/7397_smRNA/100720_7397X1_s_7_sequence.txt.gz -c 4 &gt;&amp; ~/BioAnalysis/Sue/7397_smRNA/100818_4pm_7397X1.txt &amp;</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">#Ran Novo2Bed.pl on the output file with settings --zerobase and --miRNA</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">#Ran BedAlignFilter.pl on the output of Novo2Bed.pl with settings </P><P ALIGN=""LEFT"">  1)for unique:  --maxAlign 1</P><P ALIGN=""LEFT"">  2)for 2-10: --minAlign 2 --maxAlign 10</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">#Ran BedAlignStats.pl to get statistics of the filtered output files.  Here is a summary:</P><P ALIGN=""LEFT"">	7397X1_unique.bed</P><P ALIGN=""LEFT"">		1604599 alignments (from 1602622 reads, including 1977 reads that have two bed lines because spliced.)</P><P ALIGN=""LEFT"">		Size range 17-36.  Quality scores range between 0 and 118.  Alignment scores range between 0 and 30 (with one at 33).</P><P ALIGN=""LEFT"">	7397X1_2_to_10.bed</P><P ALIGN=""LEFT"">		Repeat_alignments: 3858311		Repeat_reads: 926817</P><P ALIGN=""LEFT"">		Size range 17-36.  Quality score range 0-6 (most 0-1).  Alignment score range 0-35.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">#Made stranded ReadCoverage files.  </P><P ALIGN=""LEFT"">	for i in *Point; do mkdir -p ${i/_Point/_ReadCov}/Plus ${i/_Point/_ReadCov}/Minus; done; for i in *Point; do mv ${i}/*-* ${i/_Point/_ReadCov}/Minus; mv ${i}/*+* ${i/_Point/_ReadCov}/Plus; done</P><P ALIGN=""LEFT"">	for i in *ReadCov/*; do java -Xmx4G -jar ~/USeqApps/ReadCoverage -p $i -s ${i}_ReadCov; done; </P><P ALIGN=""LEFT"">	for i in *ReadCov/*us*ReadCov*; do java -Xmx3G -jar ~/USeqApps/Bar2USeq -f $i -r 1; done</P><P ALIGN=""LEFT"">	for i in *ReadCov; do for s in Minus Plus; do mv ${i}/${s}_ReadCov.useq ${i/_ReadCov/}_${s}_ReadCov.useq; done; done; for i in *Point; do mv ${i/_Point/_ReadCov}/Minus/* $i; mv ${i/_Point/_ReadCov}/Plus/* $i; done; rm -r *ReadCov;</P>',6716,3405,7,'Andrew','2010-08-10 00:00:00')
