adCov/}_${s}_ReadCov.useq; done; done; for i in *Point; do mv ${i/_Point/_ReadCov}/Minus/* $i; mv ${i/_Point/_ReadCov}/Plus/* $i; done; rm -r *ReadCov;</P><P ALIGN=""LEFT""></P>',6716,3405,7,'Andrew','2010-08-10 00:00:00')
