,(7031,'Multimodal RNA-seq, Lamm AT et. al. 2010','<P ALIGN=""LEFT"">Downloaded data from GEO: GSE22410</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Status	Public on Oct 20, 2010</P><P ALIGN=""LEFT"">Title	Multimodal RNA-seq using single-strand, double-strand, and circligase-based capture yields a refined and extended description of the C. elegans transcriptome</P><P ALIGN=""LEFT"">Organism	Caenorhabditis elegans</P><P ALIGN=""LEFT"">Experiment type	Expression profiling by high throughput sequencing</P><P ALIGN=""LEFT"">Summary	We have used a combination of three high-throughput RNA capture and sequencing methods to refine and augment the transcriptome map of a well studied genetic model, Caenorhabditis elegans. The three methods include a standard (non-directional) library preparation protocol relying on cDNA priming and foldback that has been used in several previous studies for transcriptome characterization in this species, and two directional protocols, one involving direct capture of single stranded RNA fragments and one involving circular-template PCR (circligase). We find that each RNA-seq approach shows specific limitations and biases, with the application of multiple methods providing a more complete map than was obtained from any single method. Of particular note in the analysis were substantial advantages of circligase-based and ssRNA-based capture for defining sequences and structures of the precise 5&apos; ends (which were lost using the double strand cDNA capture method). Of the three methods, ssRNA capture was most effective in defining sequences to the polyA junction. Using datasets from a spectrum of C. elegans strains and stages and the UCSC Genome Browser, we provide a series of tools, which facilitate rapid visualization and assignment of gene structures.</P><P ALIGN=""LEFT""> 	</P><P ALIGN=""LEFT"">Overall design	single-strand-capture, double-strand-capture, and circligase-based RNA-seq</P><P ALIGN=""LEFT""> 	</P><P ALIGN=""LEFT"">Contributor(s)	Fire AZ, Lamm AT</P><P ALIGN=""LEFT"">Citation(s)	</P><P ALIGN=""LEFT"">Lamm AT, Stadler MR, Zhang H, Gent JI et al. Multimodal RNA-seq using single-strand, double-strand, and CircLigase-based capture yields a refined and extended description of the C. elegans transcriptome. Genome Res 2011 Feb;21(2):265-75. PMID: 21177965</P><P ALIGN=""LEFT"">Submission date	Jun 17, 2010</P><P ALIGN=""LEFT"">Last update date	Jan 19, 2011</P><P ALIGN=""LEFT"">Contact name	Ayelet Lamm</P><P ALIGN=""LEFT"">E-mail(s)	ayeletla@stanford.edu</P><P ALIGN=""LEFT"">Phone	650-725-1609</P><P ALIGN=""LEFT"">Organization name	Stanford University School of Medicine</P><P ALIGN=""LEFT"">Department	Pathology</P><P ALIGN=""LEFT"">Lab	Fire Lab</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P>',7030,1204,28,'u0028003','2011-03-10 00:00:00')
