,(7257,'GNomEx A342','<P ALIGN=""LEFT"">Post-publication analysis of: http://www.sciencedirect.com/science/article/pii/S0012160611001564</P><P ALIGN=""LEFT"">http://www.ncbi.nlm.nih.gov/gds?term=GSE20600</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Extracted fastq files using fastq-dump option in NCBI&apos;S SRA Toolbox: http://trace.ncbi.nlm.nih.gov/Traces/sra/sra.cgi?cmd=show&amp;f=software&amp;m=software&amp;s=software</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">First created novoindex without including a splice junction file.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Aligned against zebrafish genome (Zv9) using novoalign: novoalign -F STDFQ -o SAM $&apos;@RG\\tID:unknownReadgroup\\tSM:unknownSample&apos; -r All 50 -t 60 -d zv9ChrPhiXAdaptrChIPSeq.nix -f SRR038567.fastq | grep -v ^@SQ | grep chr | gzip &gt; SRR038567.sam.gz</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Rep 1 for input, H3K4me1 and H3K4me3 samples consist of fastq files from all six sequencing lanes. After aligning individually with novoalign, I appended a sam header onto each sam file (USeq&apos;s FileJoiner), merged the six sams using Picard&apos;s MergeSamFiles, and passed to USeq&apos;s ChipSeq.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">MergeSamFiles params:</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">java -jar -Xmx2G /home/BioApps/picard-tools-1.43/MergeSamFiles.jar INPUT=SRR038573.sam.gz INPUT=SRR038574.sam.gz... OUTPUT=H3K4me3rep1-1.sam</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Run the ChIPSeq app (USeq) to parse raw alignments, remove duplicate reads, generate read coverage tracks, estimate peak shift, and identify ChIP-Seq peaks.</P>',7122,6303,49,'u0785353','2011-10-19 00:00:00')
