,(7272,'Differential gene expression-2','<P ALIGN=""LEFT"">Analysis of differential gene expression using USeq&apos;s DefinedRegionScanSeqs (DRSS) app. </P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">DRSS takes chromosome specific PointData xxx.bar.zip files and extracts scores under each region to calculate several statistics including a binomial p-value, Storeyq-value FDR, an empirical FDR, a p-value for strand skew, </P><P ALIGN=""LEFT"">and a chi-square test of independence between the exon read count distributions between treatment and control data (a test for alternative splicing). Several measures of read counts are provided including counts for each strand, a normalized log2 ratio, and RPKMs (# reads per kbof interrogated region per total million mapped reads). If a gene table is provided, scores under each exon are summed to give a whole gene summary. It is also recommended to run a gene table of introns (see the ExportIntronicRegions app) to look for intronic retention and novel transfrags/ exons.  If one provides splice junction bed files for treatment and control RNA-Seq data, </P><P ALIGN=""LEFT"">see the NovoalignParser, splice junctions will be scored for differential expression. This is an additional calculation unrelated to the chi-square independance test. Lastly, if control data is not provided, simple region sums are calculated.</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT"">Params: java -jar -Xmx4G /home/USeq_7.9.4/Apps/DefinedRegionScanSeqs -s /ERP000016/results/1/ -t /ERP000016/pointData/1dpf/PointData/ -c /ERP000016/pointData/malNoHeadTestis/PointData/ -p 0 -u ../ucsc/zv9EnsemblTranscripts.PSC.orig.ucsc</P><P ALIGN=""LEFT""></P><P ALIGN=""LEFT""></P>',7141,6303,49,'u0785353','2011-10-25 00:00:00')
